        function update() {
            $('#letters').empty()
            const original = [...$('#original').val().toLowerCase().replace(/\s/g, '')]
            const anagram = [...$('#anagram').val().toLowerCase().replace(/\s/g, '')]

            const diff = difference(original, anagram);
            $('#letters').append(diff.filter(l => l !== ' ').sort().map(l => {
                const div = document.createElement('div');
                div.innerHTML = l
                div.classList.add('letter')
                return div
            }));

            $('#first').empty();
            $('#first').append(
                [... new Set(names)].filter(name => isSublist([...name.toLowerCase()], diff) && name.includes($("#firstsearch").val()))
                .sort((a, b) => b.length - a.length).map(sug => {
                    const div = document.createElement('div');
                    div.classList.add('suggestion')
                    div.textContent = sug;
                    return div
                })
            );
            $('#last').empty();
            $('#last').append(
                [... new Set(lastnames)].filter(name => isSublist([...name.toLowerCase()], diff) && name.includes($("#lastsearch").val()))
                .sort((a, b) => b.length - a.length).map(sug => {
                    const div = document.createElement('div');
                    div.classList.add('suggestion')
                    div.textContent = sug;
                    return div
                })
            );
        }
        function isSublist(a, b) {
            const changing = [...b]
            for (const c of a) {
                if (changing.indexOf(c) === -1) {
                    return false;
                } else {
                    changing.splice(changing.indexOf(c), 1);
                }
            }
            return true;
        }
        function difference(a, b) {
            return [...b.reduce( (acc, v) => acc.set(v, (acc.get(v) || 0) - 1),
                    a.reduce( (acc, v) => acc.set(v, (acc.get(v) || 0) + 1), new Map() ) 
            )].reduce( (acc, [v, count]) => {
                if (count >= 0) {
                    return acc.concat(Array(Math.abs(count)).fill(v))
                } else {
                    return acc.concat(`WRONG: ${v}`)
                }},
            
            [] );
        }
        function compute() {
            const original = [...$('#original').val().toLowerCase().replace(/\s/g, '')];
            const anagram = [...$('#anagram').val().toLowerCase().replace(/\s/g, '')];

            const diff = difference(original, anagram);

            const firstnames = [... new Set(names)].filter(name => isSublist([...name.toLowerCase()], diff)).sort((a, b) => b.length - a.length);
            $('#computed').empty();

            for (let i = 0; i < firstnames.length; i++) {
                const leftover = difference(original, [...firstnames[i]])
                const lastnameoptions = lastnames.filter(name => {
                    const sorted = leftover.sort()
                    return [...name].length === leftover.length && [...name].sort().every((v, i) => v === sorted[i])
                })
                $('#computed').append([... new Set(lastnameoptions)].map(lastnameoption => {
                    const div = document.createElement('div');
                    div.classList.add('suggestion')
                    div.textContent = `${firstnames[i]} ${lastnameoption}`;
                    return div
                }))
            }
            if ($('#computed').children().length === 0) {
                const div = document.createElement('div');
                div.classList.add('suggestion')
                div.textContent = "nothing found"
                $('#computed').append(div)
            }
        }
